export const InputBox = (props) => {
  return (
    <>
      <label className="all_page_my_label_new">{props.label}</label>
      <input
        type={props.type}
        className="form-control intput_box"
        placeholder={props.placeholder}
      />
    </>
  );
};
export const TextareaBox = (props) => {
  return (
    <>
      <label className="all_page_my_label_new ">{props.label}</label>
      <textarea
        className="form-control textareaBox_box"
        rows={props.rows}
        placeholder={props.placeholder}
      ></textarea>
    </>
  );
};
export const SelectBox = (props) => {
  const SettingsIndexData = [
    {
      option: "+ 91",
      cat1: [
        {
          link: "/hr/company_setup",
          inertitle: "Company Setup",
          text: "Add your company details here",
        },
      ],
    },
  ];
  return (
    <>
      <label className="all_page_my_label_new ">{props.label}</label>
      <select class="form-select SelectBox_box">
        <option value={props.value}>+ 91</option>
        {SettingsIndexData.map((val, i) => {
          return <App key={i} option={val.option} arr={val} />;
        })}
      </select>
    </>
  );
};
